description:
@TheHcturk • A pinnacle of digital art: created from the pixel up using computer technology, not an imitation of any tangible art form. I’ve made plenty of those in my day, but this is the metamodern world, and so is my cyber city. Suitable for habitation by all genders. 
• 
(5,000-pixel PNG. View at 100% percent to grasp the sub-compositions.)
